/*Table structure for table `tbl_task_lines` */

DROP TABLE IF EXISTS `tbl_task_lines`;

CREATE TABLE `tbl_task_lines` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `group_name` varchar(100) DEFAULT NULL,
  `type` varchar(10) DEFAULT 'task',
  `description` varchar(2048) DEFAULT NULL,
  `date_created` datetime NOT NULL,
  `date_completed` datetime DEFAULT NULL,
  `date_modified` datetime DEFAULT NULL,
  `date_due` datetime DEFAULT NULL,
  `hash_key` varchar(5) DEFAULT NULL,
  `raw_command` text,
  `status` varchar(25) DEFAULT 'done',
  `is_pinned` tinyint(4) DEFAULT '0',
  PRIMARY KEY (`id`),
  UNIQUE KEY `hash` (`hash_key`),
  KEY `ordering` (`group_name`,`description`(767),`date_created`,`is_pinned`),
  KEY `is_pinned` (`is_pinned`),
  KEY `status` (`status`)
) ENGINE=InnoDB AUTO_INCREMENT=407 DEFAULT CHARSET=latin1;

